INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 1, 2, 1, 0, 0, 1.4, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "大切な人を\n守れるようになりたい…って", "草野 優衣", 1, 2, 1, 0, 0, 1.4, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "キミに必要な集中力と感性が", "士条 怜", 1, 2, 1, 0, 0, 1.4, 0, "フェンシングを始めてみては？", 1, 1003, "少しは磨かれると思いますよ。", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "今日はなにして遊ぶ？", "穂高 みそぎ", 1, 2, 1, 0, 0, 1.5, 0, "ねぇ、にいちゃん！", 1, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ねぇ…", "風宮 あかり", 1, 2, 1, 0, 0, 1.4, 0, "風宮あかりです", 1, 1006, "私といっしょに…\nいかない？", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "プリンたべたいのー", "出雲 宮子", 1, 2, 1, 0, 0, 1.5, 0, "出雲宮子なのー", 1, 1007, "食べ物の恨みは怖いのー", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 1, 2, 1, 0, 0, 1.4, 0, "ボクは虹村雪。", 1, 1008, "いいよ。\n見られることは運命さ…", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 1, 2, 1, 0, 0, 1.4, 0, "フッ…聞いて後悔するがいい！", 1, 1009, "人呼んで「疾風の冥姫」!!", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 1, 2, 1, 0, 0, 1.5, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1010, "ほんまおおきにやわ～♪", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 1, 2, 1, 0, 0, 1.4, 0, "衣之咲璃乃です！", 1, 1011, "ここで会ったが\n100年目～！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ち、超能力って…\n何のことかな～？", "柏崎 初音", 1, 2, 1, 0, 0, 1.4, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "一応カリスマ読モJKやってまっす！", "美波 鈴奈", 1, 2, 1, 0, 0, 1.4, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "東京は遊園地みたいなところさー", "喜屋武 香織", 1, 2, 1, 0, 0, 1.4, 0, "はいたーい。\n喜屋武香織さー。", 1, 1017, "でも、沖縄もとってもいいとこさー", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", 1, 2, 1, 0, 0, 1.4, 0, "支倉伊緒です。", 1, 1018, "イオちゃんって呼んでね。", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", 1, 2, 1, 0, 0, 1.5, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1020, "ミミをおいてかないでぇ～", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "あの……\nふぇ……", "栗林 くるみ", 1, 2, 1, 0, 0, 1.5, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1021, "ふぇぇぇぇぇん……", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 1, 2, 1, 0, 0, 1.4, 0, "風宮よりです。\nあああああ！", 1, 1022, "なんてありがとうございます！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "おにいちゃんどこいくの？\nえ？", "北条 綾音", 1, 2, 1, 0, 0, 1.5, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1023, "私こっち行きたいー\nね、早く早くー", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", 1, 2, 1, 0, 0, 1.4, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 1025, "これて何か違う…\nあああすみません！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "あなたは…運命の……\n伴侶……", "倉石 恵理子", 1, 2, 1, 0, 0, 1.4, 0, "……クスクス…私は\n…倉石恵理子……", 1, 1027, "離しませんわ………\n絶対に…!!", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 1, 2, 1, 0, 0, 1.4, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1028, "…そうでしょ？？", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 1, 2, 1, 0, 0, 1.4, 0, "桜井望だよ！\nよろしくねっ", 1, 1029, "あはは、\n私もまだまだだなぁ～", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", 1, 2, 1, 0, 0, 1.4, 0, "デケデケデンっ！", 1, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", 1, 2, 1, 0, 0, 1.4, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 1031, "おかしいですね……", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "けんども\nそれには足りないモンが…", "野戸まひる", 1, 2, 1, 0, 0, 1.5, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 1033, "そう、\nオラのボケに突っ込める相方が…！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ちょっと緊張しちゃって…", "綾瀬 ゆかり", 1, 2, 1, 0, 0, 1.4, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 1034, "ちょ\nちょっと一杯飲んできます…！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "知らない人とは話しちゃいけないので", "氷川 鏡華", 1, 2, 1, 0, 0, 1.5, 0, "氷川鏡華…です", 1, 1036, "これ以上お話しすることは…\nないです！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "……あ、アラーム。", "柏崎 栞", 1, 2, 1, 0, 0, 1.4, 0, "柏崎…栞です。", 1, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "私、一人も友達がいなくて……", "双葉 碧", 1, 2, 1, 0, 0, 1.4, 0, "ふ、双葉碧です。", 1, 1040, "野に咲く花が、\n唯一の話相手です。", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", 1, 2, 1, 0, 0, 1.4, 0, "三角千歌です。", 1, 1042, "そう思っています。", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", 1, 2, 1, 0, 0, 1.4, 0, "安芸真琴だ。", 1, 1043, "う、疑ってすまなかったな…", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", 1, 2, 1, 0, 0, 1.4, 0, "わらわこそは夜を総べる者！", 1, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "ぐふふふふ……はっ！", "遠見 空花", 1, 2, 1, 0, 0, 1.4, 0, "そこで騎士は妖精を乱暴に……", 1, 1045, "ｌク、クウカに何かご用ですか!?", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", 1, 2, 1, 0, 0, 1.4, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "それでは早速クエストに…", "大神 美冬", 1, 2, 1, 0, 0, 1.4, 0, "大神美冬よ！", 1, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "クエストもバトルも\n掃除も洗濯も", "星野静流", 1, 2, 1, 0, 0, 1.4, 0, "星野静流だよ！", 1, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "見ての通りの\nセクシー美少女で", "玉泉美咲", 1, 2, 1, 0, 0, 1.5, 0, "アタシは玉泉美咲。", 1, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "？？？？", "リマ", 1, 2, 1, 0, 0, 1.4, 0, "？？？", 1, 1052, "？？？？", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", 1, 2, 1, 0, 0, 1.5, 0, "モニカ・ヴァイスヴィントだ。", 1, 1053, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", 1, 2, 1, 0, 0, 1.5, 0, "モニカ・ヴァイスヴィントだ。", 1, 1058, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", "コッコロ", 1, 2, 1, 0, 0, 1.5, 0, "モニカ・ヴァイスヴィントだ。", 1, 1059, "そ、そこまでいうなら\nもらってやる", 0);
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (0, "菓子でつろうなどと\n稚拙な策を……", "キャル", 1, 2, 1, 0, 0, 1.5, 0, "モニカ・ヴァイスヴィントだ。", 1, 1060, "そ、そこまでいうなら\nもらってやる", 0);
